swaptrade_modal_desc_crosschain_valuedif:
Комиссии, учитываемые в разнице стоимости данной транзакции моста, следующие:
• Комиссия кроссчейн-моста: {bridgePriceAndFee}
• Сетевая комиссия в целевой сети: {toChainPriceAndFee}

Торговля определенным количеством токенов влияет на глубину пула ликвидности. Это, в свою очередь, изменяет общую доступность и цену токенов, что приводит к заметной разнице в ценах.

swaptrade_mid_dialog_desc_est_network_fe:
В транзакциях моста эта комиссия включает в себя сетевые комиссии как исходной цепи, так и кроссчейн-моста.

Комиссия для этой транзакции включает:
· сетевая комиссия {chain}: {value1}
· сетевая комиссия моста {bridge}: {value2}

Сетевые комиссии выплачиваются майнерам и не взимаются нашей платформой.

swaptrade_intro_dialog_desc_cross_value_:
Разница в стоимости этой транзакции выглядит следующим образом:
· сетевая комиссия {chain}: {value1}
· комиссия моста {bridge}: {value2}

Если разница в стоимости значительно больше, а комиссии, указанные выше, относительно небольшие, это значит, что сумма моста повлияла на глубину пула ликвидности этой пары токенов.

swaptrade_intro_tooltip_trade_including_:
При транзакции моста стоимость включает в себя сетевую комиссию платежной сети и часть комиссии за кроссчейн-мост. Разбивка комиссий по данной транзакции:
• Сетевая комиссия: {fromChainPriceAndFee}
• Комиссия за кроссчейн-мост: {bridgePriceAndFee}
Эти комиссии используются для покрытия расходов майнеров и не взимаются нашей платформой.

